    /*
        i
        abcabcbb
           j
        abcabcbb


     */

    public static int lengthOfLongestSubstring(String s) {
        if (s.length() == 0) return 0;
        if (s.length() == 1) return 1;

        int length = 1;
        int maxLength = 0;

        List<Character> chars = new ArrayList<>(); // known chars for current substring

        chars.add(s.charAt(0));

        for (int i = 0; i < s.length()-1; i++) { // from first to last char (first pointer)
            for (int j = i+1; j < s.length(); j++) { // from next of first pointer to last one (second pointer)
                if (!chars.contains(s.charAt(j))) { // if not duplicate
                    chars.add(s.charAt(j)); // add char to arrayList
                    length++; //add 1 to length
                    if (maxLength < length) maxLength = length; // assign max number to maxLength
                } else { // if duplicate
                    chars.clear(); // clear char arrayList
                    chars.add(s.charAt(i+1)); // add only current char
                    length = 1; // length 1
                    if (maxLength < length) maxLength = length; // assign max number to maxLength
                    break;
                }
                if (maxLength > s.length() - i) break;
            }

        }
        return maxLength;
    }


